INSERT INTO public.subject (id, name, descr) VALUES (1, 'Авто-Выставка', 'Посещение различных авто-шоу и выставок');
INSERT INTO public.subject (id, name, descr) VALUES (3, 'Экскурсия', 'Посещение различных достопримечательностей города, всевозможные экскурсии');
INSERT INTO public.subject (id, name, descr) VALUES (2, 'Ярмарка', 'Посещение различных тематических ярмарок');
INSERT INTO public.subject (id, name, descr) VALUES (4, 'VIP-тур', 'Туры, ориентированные на ценителей самого высокого уровня обслуживания. Максимум комфорта, внимания к гостям от начала тура до его завершения.');
INSERT INTO public.subject (id, name, descr) VALUES (5, 'Круиз', 'Во время морского круиза можно интересно и позавательно провести время, также как и расслабиться и вдоволь поплавать.');
INSERT INTO public.tour (id, name, album_guid, youtube_url, descr) VALUES (3, 'Все самое лучшее в Камакуре', 'guid00000000000000000000000000000000000000000000000000000103', null, 'Наша экскурсия начинается с улицы Вакамия, которую первый сёгун Японии Минатомо Ёритомо приказал соорудить в честь новости о скорейшем появлении наследника. Тропа представляет наибольший интерес весной, когда на высаженных по обеим сторонам деревьях сакуры появляются тысячи бело-розовых нежных соцветий. Наслаждаясь красивыми пейзажами вокруг, Вы дойдете до одного из главных храмов Камакуры - Цуругаока Хатимангу. Хатиман - бог-покровитель не только рода Минамото, одного из могущественнейших родов Японии того времени, но и всего самурайства. Не стоит и говорить о роскошном убранстве этого храма, сооруженного в период расцвета воинского сословия. Затем Вы пройдетесь по торговой улочке Комати-дори, где сможете приобрести сувениры, японские сладости, декоративные предметы ручной работы. По желанию, за дополнительную плату, здесь Вы можете прокатиться на настоящей рикше.');
INSERT INTO public.tour (id, name, album_guid, youtube_url, descr) VALUES (1, 'Тур на автовыставку Tokyo Motor Show', 'guid00000000000000000000000000000000000000000000000000000101', null, 'Токийский автосалон или Токио Мотор Шоу — это международная выставка автомобилей, мотоциклов и коммерческих транспортных средств. Выставка проводится раз в два года в Токио. Токийский автосалон проводится при поддержке ассоциации производителей автомобилей Японии и входит в пятёрку крупнейших автосалонов мира, наряду с автосалонами Детройта, Женевы, Франкфурта и Парижа. На шоу в Японии обычно представляют совершенно новые концептуальные машины и новейшие разработки в сфере автопрома, демонстрируется и минимальная доля серийных моделей. Стоит заметить, что крупнейшие автопроизводители в Азии, а именно компании Хонда, Ниссан и Тойота, предпочитают "выпускать в свет" свои новинки именно на этом салоне. (Кстати, другие разработки концерна Тойота можно посмотреть в официальном шоу-руме недалеко');
INSERT INTO public.tour (id, name, album_guid, youtube_url, descr) VALUES (2, 'Тур на ярмарку красоты Beautyworld Japan', 'guid00000000000000000000000000000000000000000000000000000102', null, 'Мы приглашаем всех на выставку Beautyworld Japan в октябре! BEAUTYWORLD JAPAN - крупнейшая в Японии и одна из самых престижных в мире ярмарок красоты. Эта выставка высоко ценится профессионалами индустрии красоты. Здесь Вам представится уникальная возможность увидеть инновационные продукты, а также последние тенденции в области развития косметологии в Японии. Выставка демонстрирует широкий спектр продуктов, включая косметические продукты, оборудование и аппараты, продукция для салонов, спа-продукты для поддержания здоровья, продукты ухода за волосами, продукты по уходу за ногтями, парфюмерию, туалетные принадлежности, продукция диетического питания и предметы ухода за больными, и прочую продукцию, включая различные современные услуги и технологии, относящиеся к  индустрии красоты.');
INSERT INTO public.tour (id, name, album_guid, youtube_url, descr) VALUES (4, 'Обзорная экскурсия по Киото', 'guid00000000000000000000000000000000000000000000000000000104', null, 'Всегда хотели побывать в Японии в период золотой осени, но цены не радовали глаз? Мы спешим исправить эту ситуацию! Мы предлагаем посетить столицу Токио и изумительный молодежный город Осака в рамках спецпредложения! С пакетом "виза+отель+проезд+авиабилет" Вам стоит беспокоиться только о том, чем заполнить свободное время. Впрочем, наш список экскурсий в этом может помочь');
INSERT INTO public.tour (id, name, album_guid, youtube_url, descr) VALUES (5, 'Красные клены (Япония + Тайвань)', 'guid00000000000000000000000000000000000000000000000000000105', 'ссылка1', 'Этот вариант для тех, кто хочет посмотреть разные уголки Японии в сжатые сроки, при этом не думаю о перемещениях между городами с чемоданами! На комфортабельном лайнере Diamond Princess 5*  из Токио через Нагою вы доберетесь до второй столицы Японии  - древнего города Киото. Помимо двух столиц, вы посетите две тропические жемчужины Азии: Окинаву (Япония)  и Тайбэй (Тайвань). На этих островах обещают выше 20 градусов тепла - отличная возможность застать кусочек лета в конце осени!');
